s = ""
i = 0
from collections import defaultdict
d = defaultdict(int)
while i < len(s):
    assert s[i].isdigit() and s[i + 1].isdigit() and s[i + 2].isdigit()
    j = i + 3
    while j < len(s) and not s[j].isdigit():
        j += 1
    d[s[i:i+3]] += j - i - 3
    i = j
L = list(d.items())
L.sort(key=lambda x: x[1])
print(L[-1][0] + L[0][0])